import React from "react";
import { StyleSheet, ScrollView, View, Image, Text } from "react-native";

export default function Login() {
  return (
    <ScrollView>
      <Image
        source={require("../../../assets/img/portada face2.jpg")}
        resizeMode="contain"
        style={styles.logo}
      />
    </ScrollView>
  );
}

const styles = StyleSheet.create({
  logo: {
    width: "100%",
    height: 150,
    marginTop: 20,
  },
});
